import Button from '../../pages/login/Button';
import './index.css';
import { useState} from "react";

import Api from '../../services/api';

export default function SignIn() {

  const [ email, setEmail ] = useState('');
  const [ password, setPassword ] = useState('');
 

  async function handleSubmit(){
   
    await Api.post('signInDoctor',{email, password})
    .then(response =>{
      if(response.status === 200){
        window.location.href='/painel'
      }else if(response.data.status === 404){
        alert('Este usuário não existe ou está inativo')
      }else{
        alert('Erro no servidor')
      }
    })
}


    return (
      <div>
        <div><a href="/"><img src="https://i.imgur.com/tDvwyyA.png" className = {'logo'} title="source: imgur.com" /></a></div>
        <br></br>
        <br></br>
        <br></br>
        <br></br>
        <br></br>
        <br></br>
        <form className={'form'}>
        <text>Faça seu login</text>
          <br></br>
          <br></br>
          <br></br>
          <label>
            E-mail:
            <input type="text" name="Email" 
            onChange={e => setEmail(e.target.value)} />
          </label>
          <label>
            Senha:
            <input type="password" name="mail" 
            onChange={e => setPassword(e.target.value)}/>
          </label>
          <br></br>
            <Button onClick={handleSubmit}>
              Entrar
            </Button>
            <br></br>
            <br></br>
            <label1>Esqueci a senha</label1>
            <label2>Cadastrar-se</label2>
         </form>
        
      </div>
  );
    }
